import './Catalog.css';

import { Button, Col, Container, Row } from "react-bootstrap";

import Photo1 from '../Catalog/CatalogImage/photo1.jpeg';

function Catalog(){

    const ArraysOfCatalog = [{
        id: 1,
        image: Photo1,
        title: 'Creating is a privilege but it’s also a gift',
        text: 'Nullam vel lectus vel velit pellentesque dignissim nec id magna. Cras molestie ornare quam at semper. Proin a ipsum ex. Curabitur eu venenatis justo. ',
        button1: 'LifeStyle',
        button2: 'People',
        button3: 'Review'
    }];
    const ArraysOfCatalogOnMap = ArraysOfCatalog.map((ArrayOfCatalog) => 
    <Col className = "card-wrapper" key = {ArrayOfCatalog.id} lg = "4" md = "6" sm = "12">
        <div className = "card-image">
            <img src = {ArrayOfCatalog.image} className = "w-100 card-image"/>
        </div>

        <div className = "card-button">
            <Button variant='secondary' size='sm'>{ArrayOfCatalog.button1}</Button>
            <Button variant='secondary' size='sm'>{ArrayOfCatalog.button2}</Button>
            <Button variant='secondary' size='sm'>{ArrayOfCatalog.button3}</Button>
        </div>

        <div className = "card-info">
            <h2>{ArrayOfCatalog.title}</h2>
            <p>{ArrayOfCatalog.text}</p>
        </div>
    </Col>
    )

    return(
        <Container fluid>
            <Row>
                {ArraysOfCatalogOnMap}
            </Row>
        </Container>
    )
}

export default Catalog
